config.formatModule:
module.runOnceOnLoad(function(){


    var el=module.getElement();
    var cloud=module.getCloud();

    var catTree=<?php 

    echo json_encode(GetWidget('services-config')->getParameter('categories'));
        ?>;


            var container=new Element('div');
            el.appendChild(container);
            container.appendChild(new Element('label',{html:"Sub Categories"}));
            var subCloud=(new TagCloud(container, {
                tags:[]
            })).show();



      cloud.addEvent('onSelectWord',function(){

          var tags=[];
          module.getValues().forEach(function(w){

              var subTags=catTree[w].filter(function(c){

                  return Object.keys(catTree).indexOf(c)<0&&tags.indexOf(c)<0;
              })

              tags=tags.concat(subTags);
              subCloud.setTags(tags);


          });



      })




})
